import React from 'react';
import './card.css';

export default class Card extends React.Component {
    render() {
        return (
            <article className="card-item">
                <div className="cards-image__container">
                    <img className="cards-image" src="./img/1.png" alt="anapa" width="240" height="320"/>
                </div>
                <section className="card-item__description">
                    <h4 className="description-name">Морской круиз в Анапу</h4>
                    <p className="track-shedule">Маршрут</p>
                    <p className="duration">Продолжительность</p>
                    <p className="price">27 000 руб</p>
                </section>
            </article>
        )
    }
}
